import { useState } from "react";


function EventList () {

    const [events, setEvent] = useState([]);

    return(
        <div>
            <h1>List of all Events</h1>
            <ul>
                {events.map(event => {
                    <li key={event.id}>
                       <p>{event.title}</p>
                       <p>{event.date}</p>
                       <p>{event.time}</p>
                       <p>{event.location}</p>
                       <p>{event.description}</p>
                       <button></button>
                    </li>
             })}
            </ul>
        </div>
    )
}

export default EventList;
